  10,\n\t\"tags\": [],\n\t\"title\": \"Ecological studies in the Bays and other waterways
  near Little Egg Inlet and in the Ocean in the vicinity of the proposed site for
  the Atlantic Generating Station, New Jersey (NODC Accession 7500270)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-22T20:12:45.059232\",\n\t\"name\": \"ecological-studies-in-the-bays-and-other-waterways-near-little-egg-inlet-and-in-the-ocean-in-th\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In September, 1971, Ichthyological Associates
  began an ecological study of Ocean sites off Long Beach Island and Little Egg Inlet,
  New Jersey, for Public Service Electric and Gas Company. After 1 March 1972, sampling
  was restricted to the vicinity of the proposed Site of the Atlantic Generating Station
  (AGS).nnThe AGS is to be located approximately 2.8 statute miles off the coastline
  (off Little Egg Inlet) at 39 degree -28' - 20\" N latitude and 74 degree - 15' -
  20\" W longitude. Two 1150 MWe nuclear generating units will be on floating barges
  and protected by a large semicircular, rubblemound breakwater.nnThe first objective
  of the study was to identify and describe the biota of the area both spatially and
  temporally. Subsequently, the Site was examined to determine if it was unique biologically
  from the surrounding area. This was done in part of the benthic program by comparing
  a transect (inshore-offshore) across the Site with ones north, south, and seaward
  of the Site.nnThis progress reports covers the period January through December,
  1973. Quantitative data were obtained whenever possible and were statistically analyzed
  to relate information on populations at the Site to those from surrounding areas.
  Species discussions are presented which summarize biological findings for most of
  the important forms in the area.nnThe report is organized into three volumes. This
  volume contains data on epifauna, algae, benthic invertebrates, and a discussion
  and distribution maps of important species of fish and macro-invertebrates. A point
  summary for the first three sections above is included on page 12 to page 15 in
  Volume 1. Physiochemical data pertinent to all biological collections in 1973 is
  included on page 19 to 24 in Volume 1.\",\n\t\"license_title\": null,\n\t\"extras\":
